import "./App.css";

function Square() {
  return <div className="chess">Hee</div>;
};

function App() {

  const renderRows = () => {
    let rows = [];
    let eachLine = [];
    for(let i = 0; i < 8; i++){
      for(let j = 0; j < 8; j++){
        eachLine.push(<Square />);
      };
      rows.push(eachLine);
      eachLine = [];
    };
    console.log(rows, 'rows');
    return rows;
  };

  return <div className="App">{
    renderRows().map((row, rowIndex) => {
      <div>
      {row.map((square, squareIndex) => {
        return <Square />
      })}
      </div>
    })
    }</div>;
};

export default App;
